import React from 'react';
export default function Contact() {
  return (
    <section className="p-8 text-white">
      <h2 className="text-3xl font-bold mb-4">Contact</h2>
      <p>Email: devbansal763@gmail.com</p>
      <p>LinkedIn: <a href="https://www.linkedin.com/in/devbansals" className="underline">devbansals</a></p>
      <p>GitHub: <a href="https://github.com/Devb1234" className="underline">Devb1234</a></p>
    </section>
  );
}
